import React from "react";
import TextField from '@mui/material/TextField';
import Grid from '@mui/material/Grid';
import Slider from '@mui/material/Slider';
import Box from '@mui/material/Box';
import './Services.css';
import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormLabel from '@mui/material/FormLabel';
import { Button} from 'react-bootstrap';

import Input from '@mui/material/Input';
import FilledInput from '@mui/material/FilledInput';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import InputAdornment from '@mui/material/InputAdornment';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';

const marks = [
    {
      value: 0,
      label: 'Male',
    },
    {
      value: 1,
      label: 'Female',
    },
  ];
  const ecg=[
    {
      value:0,
      label:0,
    },
    {
      value:1,
      label:1,
    },
    {
      value:2,
      label:2,
    },

  ]
  const chest_pain =[
   {
    value:0,
    label: "&nbsp  Asymptomatic",
   },
   {
    value:1,
    label: 'Typical Angina',
   },
   {
    value:2,
    label: 'Atypical Angina',
   },
   {
    value:3,
    label: 'Non-Anginal Pain',
   },
  ];
const Services = () => {
    return (

      <div>
        <h1 className="serv">Services</h1>
        <form>
            <Grid container spacing={6}>
                <Grid item xs={6}  >

                <label>Age</label> <br></br>
                <TextField
                className="grid1"
                variant='outlined'
                label='Age'
                type='number'
                />

                <Box className="grid1 gr">
                 <label >Chest Pain(0 = Asymptomatic, 1 = Typical Angina, 2 = Atypical Angina, 3 = Non-Anginal Pain)</label>   
                <Slider
                label="Chest Pain"
                defaultValue={1}
                step={null}
                marks={chest_pain}
                min={0}
                max={3}
                valueLabelDisplay="auto"

                />
                </Box>

                <label>Blood Pressure</label><br></br>
                <TextField 
                className="grid1" 
                variant='outlined'
                label='Blood Pressure'
                type='number'
                /><br></br><br></br><br></br>
                <label>Max Heart Rate achieved</label><br></br>
                <TextField 
                className="grid1" 
                variant='outlined'
                label='Heart Rate'
                type='number'
                />

                <Box className="grid1 gr">
                <label>ECG at Rest</label>   
                <Slider 
                label="ECG"
                defaultValue={0}
                step={1}
                marks={ecg}
                min={0}
                max={2}
                valueLabelDisplay="off"           
                />
                </Box>
                <Box className="grid1 gr">
                <label>Slope of ST segment (0 = Downsloping, 1 = Upsloping, 2 = Flat)</label>   
                <Slider 
                label="ECG"
                defaultValue={0}
                step={1}
                marks={ecg}
                min={0}
                max={2}
                valueLabelDisplay="off"           
                />
                </Box>
                </Grid >
                <Grid item xs={6} >
                <Box className="grid2">
                <label>Gender</label>   
                <Slider 
                label="Gender"
                defaultValue={0}
                step={1}
                marks={marks}
                min={0}
                max={1}
                valueLabelDisplay="off"           
                />


                </Box>

                <label class="grid2" >Cholesterol(mg/dl)</label><br></br>
                <TextField
                class="text3" 
                variant='outlined'
                label=''
                type='number'

                />
                <br></br>
                <FormControl class="grid2">
                <FormLabel id="demo-radio-buttons-group-label">Fasting Blood Sugar (mg/dl)</FormLabel>
                <RadioGroup
                    aria-labelledby="demo-radio-buttons-group-label"
                    defaultValue="less"
                    name="radio-buttons-group"
                >
                    <FormControlLabel value="less" control={<Radio />} label="Less than or equal to 120" />
                    <FormControlLabel value="more" control={<Radio />} label="More than 120" />

                </RadioGroup><br></br><br></br>

                <FormLabel id="demo-radio-buttons-group-label">Excercise Induced Angina</FormLabel>
                <RadioGroup
                    aria-labelledby="demo-radio-buttons-group-label"
                    defaultValue="yes"
                    name="radio-buttons-group"
                >
                    <FormControlLabel value="yes" control={<Radio />} label="Yes" />
                    <FormControlLabel value="no" control={<Radio />} label="No" />

                </RadioGroup><br></br><br></br>

                <FormLabel id="demo-radio-buttons-group-label">Thalassemia</FormLabel>
                <RadioGroup
                    aria-labelledby="demo-radio-buttons-group-label"
                    defaultValue="normal"
                    name="radio-buttons-group"
                >
                    <FormControlLabel value="normal" control={<Radio />} label="Normal" />
                    <FormControlLabel value="fixed" control={<Radio />} label="Fixed Defect" />
                    <FormControlLabel value="reversible" control={<Radio />} label="Reversible Defect" />

                </RadioGroup>
                </FormControl>
                </Grid>

            </Grid>
        </form>

        <Button class="predict">
          Predict
        </Button>
      </div>

    )
  }

  export default Services;
